function GetIcon(name:string,ending:string="png"){
    let image
    console.log(`./Icons/${name}.${ending}`)

    try  {
        image = require(`./Icons/${name}.${ending}`)
        return image;
    }
    catch{
        console.log("image not found"); image=""
    }
    return image;
}

